        <h1 className="bg-gray-200 text-xl text-center rounded-lg font-Poppins font-bold mb-6 inline-block px-4 py-2">
          VISIT OUR CUSTOMERS TOUR GALLERY</h1>
      </div>
      <div className="grid grid-rows-none md:grid-cols-5 py-4 gap-2 md:gap-4">
        <div className="grid grid-cols-4 gap-2">
          <img className="w-full h-full object-cover" src="https://cdn.discordapp.com/attachments/1086315786446061711/1127161140976300043/A-5-1K.jpg" alt="/" />
