          <img className="w-full h-full object-cover" src="https://cdn.discordapp.com/attachments/1086315786446061711/1127161140976300043/A-5-1K.jpg" alt="/" />
          <img className="w-full h-full object-cover" src="https://cdn.discordapp.com/attachments/1086315786446061711/1127161140976300043/A-5-1K.jpg" alt="/" />
        </div>
        <img className="w-full h-full object-cover col-span-2 md:col-span-3 row-span-2" src="https://cdn.discordapp.com/attachments/1086315786446061711/1127209204017528852/WhatsApp-Image-2023-05-06-at-22.20.30-1024x768.jpeg" alt="/" />
      </div>
    </div>
  );
};

export default Gallery;
